import { Route, Routes } from "react-router-dom";
import Global from "./components/Global/Global";
import Home from "./pages/Home";

function App() {
  return (
    <div>
      {}
      <Routes>
        <Route path="/" element={Global} />
      </Routes>
    </div>
  );
}

export default App;
